import React, { useEffect, useState } from 'react'
import { StyleSheet, View, TextInput } from 'react-native'

const SearchScreen = () => {
  return (
    <View>
      <TextInput style={styles.textInput} />
    </View>
  )
}

const styles = StyleSheet.create({
  textInput: {
    borderWidth: 1,
    borderColor: '#CCCCCC',
    height: 35,
    padding: 50,
  },
})

export default SearchScreen
